  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains color (RGB) ortho-rectified
  mosaic tiles, created as a product from the NOAA Integrated Ocean and Coastal Mapping
  (IOCM) initiative. The source imagery was acquired from 20100806 - 20100930. The
  images were acquired with an Applanix Digital Sensor System (DSS). Ortho-rectified
  mosaic tiles are an ancillary product of NOAA's Coastal Mapping Program (CMP), created
  through a wider Integrated Ocean and Coastal Mapping initiative to increase support
  for multiple uses of the data. The ground sample distance (GSD) for each pixel is
  0.50 m.nnThese data are Geotiff (.tif) files with associated Federal Geographic
  Data Committee (FGDC) metadata.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
